CREATE TABLE IF NOT EXISTS `area_types` (`id` integer primary key autoincrement, `code` text NOT NULL, `name` text NOT NULL, `isOld` integer NOT NULL DEFAULT '0')

CREATE TABLE IF NOT EXISTS `areas` (`id` integer primary key autoincrement, `code` text NOT NULL, `id_parent` integer DEFAULT NULL, `type` integer NOT NULL, `name` text NOT NULL, `doc` text DEFAULT NULL, `okato` text DEFAULT NULL, `okato_ks` text DEFAULT NULL)

CREATE TABLE IF NOT EXISTS `areas_history` (`id` integer primary key autoincrement, `id_area` integer NOT NULL DEFAULT '0', `code` text DEFAULT NULL, `name` text DEFAULT NULL, `type` integer DEFAULT NULL, `doc` text DEFAULT NULL)

CREATE TABLE IF NOT EXISTS `street_areas` (`id` integer primary key autoincrement, `street` integer NOT NULL, `area` integer NOT NULL)

CREATE TABLE IF NOT EXISTS `street_history` (`id` integer primary key autoincrement, `id_street` integer NOT NULL, `name` text NOT NULL, `type` integer DEFAULT NULL, `doc` text DEFAULT NULL)

CREATE TABLE IF NOT EXISTS `street_types` (`id` integer primary key autoincrement, `code` text NOT NULL, `name` text NOT NULL, `short_name` text NOT NULL)

CREATE TABLE IF NOT EXISTS `streets` (`id` integer primary key autoincrement, `code` integer NOT NULL, `name` text NOT NULL, `type` integer NOT NULL, `doc` text DEFAULT NULL, `sort` text DEFAULT NULL, `sort_second` text DEFAULT NULL, `position` text DEFAULT NULL)
